import React from "react";
import ReactDOM from "react-dom/client";
import App from "./App";
import GlobalStyle from "./Global.styled";
import { Router } from "./Router";

const root = ReactDOM.createRoot(
  document.getElementById("root") as HTMLElement
);
root.render(
  <React.StrictMode>
    <GlobalStyle />
    <App />
  </React.StrictMode>
);
